import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assests/basilurlogo.png'; // Import logo

const AdminPage = () => {
  return (
    <div
      className="min-h-screen flex flex-col"
      style={{
        backgroundColor: '#FFFFFF', // White background for the page
        margin: 0, // Remove any margin for the body to ensure layout
        padding: 0, // Remove any padding that may add extra space
      }}
    >
      {/* Header */}
      <header
        className="flex items-center p-2 mx-auto"
        style={{
          backgroundColor: '#191919', // Black header background
          color: '#FFFFFF', // White font color
          borderRadius: '30px', // Rounded header corners
          height: '50px', // Smaller height
          width: '85%', // Header width
          marginTop: '20px', // Space from top
          boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)', // Subtle shadow
          paddingTop: '5px', // Adjust padding to make header more compact
          paddingBottom: '5px', // Adjust padding to make header more compact
        }}
      >
        {/* Logo */}
        <img
          src={logo}
          alt="Logo"
          className="mr-4"
          style={{
            width: '40px', // Logo size
            height: '40px',
            objectFit: 'contain',
          }}
        />
        {/* Title */}
        <h1
          className="text-lg font-bold flex-1 text-center"
          style={{
            color: '#FFFFFF', // White text color
          }}
        >
          Admin Dashboard
        </h1>
      </header>

      {/* Navigation Bar Section */}
      <div
        className="flex justify-center items-center mt-4"
        style={{
          width: '85%', // Match header width
          marginTop: '20px', // Space between header and navbar
        }}
      >
        <Link to="/add-freight-agent">
          <button
            className="p-3 rounded-md border-2 text-lg"
            style={{
              borderColor: '#FF4D00', // Orange border color
              backgroundColor: 'transparent',
              color: '#FF4D00', // Orange text
              transition: 'background-color 0.3s ease, color 0.3s ease',
            }}
            onMouseOver={(e) => {
              e.target.style.backgroundColor = '#FF4D00'; // Orange background on hover
              e.target.style.color = '#FFFFFF'; // White text on hover
            }}
            onMouseOut={(e) => {
              e.target.style.backgroundColor = 'transparent'; // Transparent background
              e.target.style.color = '#FF4D00'; // Orange text
            }}
          >
            Add Freight Agent
          </button>
        </Link>

        <span className="mx-2 text-orange-500">|</span> {/* Vertical line separator */}

        <Link to="/add-freight-coordinator">
          <button
            className="p-3 rounded-md border-2 text-lg"
            style={{
              borderColor: '#FF4D00', // Orange border color
              backgroundColor: 'transparent',
              color: '#FF4D00', // Orange text
              transition: 'background-color 0.3s ease, color 0.3s ease',
            }}
            onMouseOver={(e) => {
              e.target.style.backgroundColor = '#FF4D00'; // Orange background on hover
              e.target.style.color = '#FFFFFF'; // White text on hover
            }}
            onMouseOut={(e) => {
              e.target.style.backgroundColor = 'transparent'; // Transparent background
              e.target.style.color = '#FF4D00'; // Orange text
            }}
          >
            Add Freight Coordinator
          </button>
        </Link>

        <span className="mx-2 text-orange-500">|</span> {/* Vertical line separator */}

        <Link to="/add-main-user">
          <button
            className="p-3 rounded-md border-2 text-lg"
            style={{
              borderColor: '#FF4D00', // Orange border color
              backgroundColor: 'transparent',
              color: '#FF4D00', // Orange text
              transition: 'background-color 0.3s ease, color 0.3s ease',
            }}
            onMouseOver={(e) => {
              e.target.style.backgroundColor = '#FF4D00'; // Orange background on hover
              e.target.style.color = '#FFFFFF'; // White text on hover
            }}
            onMouseOut={(e) => {
              e.target.style.backgroundColor = 'transparent'; // Transparent background
              e.target.style.color = '#FF4D00'; // Orange text
            }}
          >
            Add Main User
          </button>
        </Link>
      </div>

      {/* Add Freight Agent Form Section */}
      <main
        className="flex justify-center items-center"
        style={{
          marginTop: '40px', // Space before the form section
        }}
      >
        <div
          className="p-8 rounded-lg shadow-lg w-96"
          style={{
            backgroundColor: '#FFFFFF',
            borderRadius: '16px',
            border: '1px solid rgba(25, 25, 25, 0.1)',
            boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
          }}
        >
          <h2
            className="text-2xl mb-6 font-semibold"
            style={{
              color: '#191919',
              textAlign: 'center',
            }}
          >
            Add Freight Agent
          </h2>
          <form className="flex flex-col">
            {/* Input Fields */}
            <div className="mb-4">
              <label
                htmlFor="name"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Name:
              </label>
              <input
                type="text"
                id="name"
                name="name"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            <div className="mb-4">
              <label
                htmlFor="address"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Address:
              </label>
              <input
                type="text"
                id="address"
                name="address"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            <div className="mb-4">
              <label
                htmlFor="contact"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Contact Number:
              </label>
              <input
                type="text"
                id="contact"
                name="contact"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            <div className="mb-4">
              <label
                htmlFor="email"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Email:
              </label>
              <input
                type="email"
                id="email"
                name="email"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            <h3 className="text-xl font-semibold mt-6 mb-4">Director 01</h3>

            <div className="mb-4">
              <label
                htmlFor="director1-contact"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
              >
                Contact Number:
              </label>
              <input
                type="text"
                id="director1-contact"
                name="director1-contact"
                className="w-full p-3 border rounded-md text-sm"
                style={{
                  borderColor: '#191919',
                  backgroundColor: '#FFFFFF',
                  color: '#191919',
                }}
              />
            </div>

            <div className="mb-4">
              <label
                htmlFor="director1-email"
                className="block mb-2 text-sm"
                style={{ color: '#191919' }}
